import React from 'react';
import NavbarTop from './NavbarTop';
import lessonincomplete from '../img/lessonincomplete.svg';
import '../App.css';

function Dashboard() {
	return (
		<header>
			<NavbarTop />
			<div style={styles.container}>
				<img src={lessonincomplete} style={styles.lessonElement} />
				<p
					style={
						(styles.defaultFontFamily,
						{ fontWeight: '700', color: '#606f7bff' })
					}
				>
					Basics training
				</p>
			</div>
		</header>
	);
}

const styles = {
	defaultFontFamily: {
		fontFamily: 'din-round, sans-serif'
	},
	lessonElement: {
		height: '15vmin'
	},
	container: {
		minHeight: '100vh',
		display: 'flex',
		flexDirection: 'column',
		alignItems: 'center',
		justifyContent: 'center',
		fontSize: 'calc(10px + 2vmin)'
	}
};
export default Dashboard;
